import React from "react";

function Body() {
    const Types = [Action, Adventure, animation, Comedy, Crime, Documentary, Drama]

  return (
    <main>
          <div class="button-container">
              {Types.map((data) => {
                  <button class="my-button" >Action</button>;
              })}
        <button class="my-button">Action</button>
        <button class="my-button">Adventure</button>
        <button class="my-button">Animation</button>
        <button class="my-button">Comedy</button>
        <button class="my-button">Crime</button>
        <button class="my-button">Documentary</button>
        <button class="my-button">Drama</button>
        <button class="my-button">Family</button>
        <button class="my-button">Fantasy</button>
        <button class="my-button">History</button>
        <button class="my-button">Horror</button>
        <button class="my-button">Music</button>
        <button class="my-button">Mystery</button>
        <button class="my-button">Romance</button>
        <button class="my-button">Science fiction</button>
        <button class="my-button">Tv Movie</button>
        <button class="my-button">Thriller</button>
        <button class="my-button">War</button>
        <button class="my-button">Western</button>
      </div>
    </main>
  );
}

export default Body;
